import React, { Fragment } from 'react';
import { TouchableOpacity, View, Dimensions } from 'react-native';
import { EvilIcons } from '@expo/vector-icons';
import { Context } from '../Provider';

// Componetns
import ProfileTop from './ProfileTop';
import Input from './Input';
import { globalStyles } from '../styles';

function Login({ navigation }) {
	const { height, width } = Dimensions.get('window');
	return (
		<Context.Consumer>
			{(val) => {
				return (
					<View style={{ zIndex: 99, position: 'absolute', flex: 1, height: height, width: width }}>
						<ProfileTop />
						<TouchableOpacity style={globalStyles.closeIcon} onPress={() => navigation.goBack()}>
							<EvilIcons name="close" size={24} color="white" />
						</TouchableOpacity>
						<Input changeName={val.changeName} changeNumber={val.changeNumber} navigation={navigation} />
					</View>
					// </Fragment>
				);
			}}
		</Context.Consumer>
	);
}

export default Login;
